import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Grid from '@material-ui/core/Grid';
import FormLabel from '@material-ui/core/FormLabel';
import FormControlLabel from '@material-ui/core/FormControlLabel';
import RadioGroup from '@material-ui/core/RadioGroup';
import Radio from '@material-ui/core/Radio';
import Paper from '@material-ui/core/Paper';

import { Form, InputGroup, FormControl, Col } from 'react-bootstrap';

const useStyles = makeStyles((theme) => ({
    root: {
      flexGrow: 1,
      margin: '10px'
    },
    Navbar: {
      padding: theme.spacing(6),
      textAlign: 'center',
      color: theme.palette.text.secondary,
      backgroundColor: 'rgb(211, 241, 171)',
    },
    Footer: {
      padding: theme.spacing(6),
      textAlign: 'center',
      color: theme.palette.text.secondary,
      backgroundColor: 'rgb(211, 241, 171)',
    },
    PaperL: {
      padding: theme.spacing(1),
      height: 700 ,
      textAlign: 'center',
      color: theme.palette.text.secondary,
    },
    PaperR: {
      padding: theme.spacing(2),
      height: 600 ,
      textAlign: 'center',
      color: theme.palette.text.secondary,
      backgroundColor: 'rgb(211, 241, 171)',
    },
    Button: {
      '& > *': {
        margin: theme.spacing(1),
        padding: '20px',
        margin: '4px',
        position: 'relative',
        justify: 'space-evenly'
      },
    logout: {
      marginTop: '50px',
    }},
    login:{
        margin: '15px',
        height: '120px',
        width: '380px',
    }
  }));
  

function Login() {
    const classes = useStyles();

    return (
        <Grid container spacing={3}>
            <Grid item xs={12}>
                <Paper elevation={0} className={classes.Navbar}>
        
                </Paper>
            </Grid>

            <Grid item xs={2}>
                <Paper elevation={0} className={classes.PaperR}>
                    
                </Paper>
            </Grid>

            <Grid item xs={8}>
                <Paper elevation={3} className={classes.PaperL}>
                    <Grid item xs={2} >
                        <Paper elevation={3} className={classes.login}>
                            asdasdsad
                        </Paper>
                    </Grid>
                    <Grid item xs={4} >
                    <Form>
                            <Form.Group >
                                <Form.Control type="text" size="md" placeholder="Part Code"  />
                            </Form.Group>
                            <Form.Group >
                                <Form.Control type="text" size="md" placeholder="Part Code"  />
                            </Form.Group>
                            <Form.Group >
                            <button variant="contained" fullWidth color="Primary" >
                                Add to Store
                            </button>
                        </Form.Group>
                    </Form>
                    </Grid>
                </Paper>
            </Grid>

            <Grid item xs={2}>
                <Paper elevation={0} className={classes.PaperR}>
                   
                </Paper>
            </Grid>

            <Grid item xs={12}>
              <Paper elevation={0} className={classes.Footer}>
               
              </Paper>
            </Grid>

        </Grid>
    )
}

export default Login
